import React from "react";

function Main(props){
    return(
        <main className="main">
            <div className="main__about-team bg-white w-11/12 p-8 mx-auto mt-24 rounded-3xl flex justify-around">
                <div className="">
                    <img src={props.avatar} alt="team avatar"/>
                </div>
                <div className="">
                    <p>{props.description}</p>
                </div>
            </div>
            <div className="main__about-bg-white w-11/12 p-8 mx-auto mt-24 rounded-3xl flex justify-around">
                .
            </div>
        </main>
)
}

export default Main;
